private final ResourceEventHandler<V1ConfigMap> handler=new ResourceEventHandler<>(){
  @Override public void onAdd(  V1ConfigMap configMap){
    LOG.debug(() -> "ConfigMap " + configMap.getMetadata().getName() + " was added in namespace "+ configMap.getMetadata().getNamespace());
    onEvent(configMap);
  }
  @Override public void onUpdate(  V1ConfigMap oldConfigMap,  V1ConfigMap newConfigMap){
    LOG.debug(() -> "ConfigMap " + newConfigMap.getMetadata().getName() + " was updated in namespace "+ newConfigMap.getMetadata().getNamespace());
    if (Objects.equals(oldConfigMap.getData(),newConfigMap.getData())) {
      LOG.debug(() -> "data in configmap has not changed, will not reload");
    }
 else {
      onEvent(newConfigMap);
    }
  }
  @Override public void onDelete(  V1ConfigMap configMap,  boolean deletedFinalStateUnknown){
    LOG.debug(() -> "ConfigMap " + configMap.getMetadata().getName() + " was deleted in namespace "+ configMap.getMetadata().getNamespace());
    onEvent(configMap);
  }
}
;

private final ResourceEventHandler<V1Secret> handler=new ResourceEventHandler<>(){
  @Override public void onAdd(  V1Secret secret){
    LOG.debug(() -> "Secret " + secret.getMetadata().getName() + " was added in namespace "+ secret.getMetadata().getNamespace());
    onEvent(secret);
  }
  @Override public void onUpdate(  V1Secret oldSecret,  V1Secret newSecret){
    LOG.debug(() -> "Secret " + newSecret.getMetadata().getName() + " was updated in namespace "+ newSecret.getMetadata().getNamespace());
    if (KubernetesClientEventBasedSecretsChangeDetector.equals(oldSecret.getData(),newSecret.getData())) {
      LOG.debug(() -> "data in secret has not changed, will not reload");
    }
 else {
      onEvent(newSecret);
    }
  }
  @Override public void onDelete(  V1Secret secret,  boolean deletedFinalStateUnknown){
    LOG.debug(() -> "Secret " + secret.getMetadata().getName() + " was deleted in namespace "+ secret.getMetadata().getNamespace());
    onEvent(secret);
  }
}
